function(internalc, myorigin) {
    /***** START - list suffix: hide the client footer when next up renders *****/
    try {
        var footer = document.getElementsByClassName('sticky_footer')[0],
            style = document.createElement('style'),
            ref = document.querySelector('script');
        style.innerHTML =
            '.tbl-hide-class{' +
            'display: none !important;' +
            '}' +
            '.tbl-show-class{' +
            'display = block;' +
            '}';
        // add stylesheet to the DOM - before the first script tag
        if(ref){
            ref.parentNode.insertBefore(style,ref);
        }
        TRC.oberverAPI = function(){
            // display and hide the footer function
            var callback = function(element, intersectionObserver ,state){
                // element is on screen
                if(state === 1 || state === 2) {
                    footer.classList.add('tbl-hide-class');
                }
            }
            // obj
            var observerParams = {
                targetElement: internalc,
                onTrigger: callback
            };
            // TRC fuction
            TRC.intersections.isInViewPort(observerParams);
        }
        if (footer && internalc){
            TRC.oberverAPI();
        }
    }
    catch (e) {
        __trcError('Error in list suffix (blend-next-up-a) ' + e.message);
    };
    /***** END - list suffix *****/
},"item-renderer":
function (box,data) {
    try {
        /** For abtest - PUB-32191 , change the branding of OC item in next-up **/
        if(!data.isSyndicated){
            data.branding = 'NDTV.com'
            if(box.querySelector('.branding')){
                box.querySelector('.branding').innerText = data.branding;
            }
        }
    }
    catch (e) {
        __trcError('Error in list suffix - next up: ' + e.message);
    }
}
